// src/router/index.js - routes for project pages



import { createRouter, createWebHashHistory } from 'vue-router';
import Project from '@/components/Project.vue'

const routes = [
  { path: '/Projects/PrintCard',  name: 'PrintCard', component: Project, props: { title: 'Print Card', description: 'Description for Print Card', link: 'https://example.com/printcard' } },
  { path: '/Projects/CardDesigner', name: 'CardDesigner', component: Project, props: { title: 'Card Designer', description: 'Description for Card Designer', link: 'https://example.com/card-designer' } },
  { path: '/Projects/PortfolioWebsite', name: 'PortfolioWebsite', component: Project, props: { title: 'Portfolio Website', description: 'Description for Portfolio Website', link: 'https://example.com/portfolio-website' } }
]

const router = createRouter({
  history: createWebHashHistory(),
  routes,
  scrollBehavior() {
    return { top: 0 }
  }
})

export default router
